goog.provide("goog.structs.CollectionTest");goog.setTestOnly("goog.structs.CollectionTest");goog.require("goog.structs.AvlTree");goog.require("goog.structs.Set");goog.require("goog.testing.jsunit");function testSet(){var set=new goog.structs.Set;exerciseCollection(set)}function testAvlTree(){var tree=new goog.structs.AvlTree;exerciseCollection(tree)}function exerciseCollection(collection){assertEquals(0,collection.getCount());for(var i=1;10>=i;i++){assertFalse(collection.contains(i));collection.add(i);assertTrue(collection.contains(i));assertEquals(i,collection.getCount())}assertEquals(10,collection.getCount());for(var i=10;0<i;i--){assertTrue(collection.contains(i));collection.remove(i);assertFalse(collection.contains(i));assertEquals(i-1,collection.getCount())}assertEquals(0,collection.getCount())}